css:
.cli-status.panel {
  margin-bottom: 0px;
}
.cli-status .cli-panel-input {
  display: flex;
  justify-content: flex-end;
  padding: 10px 0;
  min-height: 25px;
}
.cli-status atom-text-editor[mini] {
  flex: 1;
  margin-right: 10px;
  margin-left: 10px;
}
.cli-status .cli-panel-body {
  white-space: pre;
  word-wrap: break-word;
  font-family: monospace;
}
.cli-status .panel-heading {
  display: none;
}
.cli-status .btn-group {
  display: flex;
  align-items: center;
  justify-content: flex-end;
}
.cli-status .btn-group > * {
  margin-left: 10px;
}
.cli-status .btn-group .btn:first-of-type:not(:last-of-type) {
  border-radius: 3px 0 0 3px;
}
.cli-status .btn-group .btn:last-of-type:not(:first-of-type) {
  border-radius: 0 3px 3px 0;
}
.cli-status .btn-group .hide + .btn:last-of-type {
  border-radius: 3px;
}
.cli-status .terminal {
  max-height: 30vh;
  overflow-y: scroll;
  bottom: 10px;
  border-radius: 0;
  color: #abb2bf;
  background: #282c34;
  border: 1px solid #181a1f;
}
.cli-status .terminal .file-info {
  width: 140px;
  display: inline-block;
  float: left;
}
.cli-status .terminal .stat-program {
  color: #26c26a;
}
.cli-status .terminal .stat-link {
  color: #cd7de8;
}
.cli-status .terminal .clear {
  clear: both;
}
.cli-status .status-ignored {
  opacity: 0.5;
}
.cli-status .status-running {
  color: #00ffff;
}
.cli-status .status-info {
  color: #0055ff;
}
.cli-status .status-success {
  color: #55ff00;
}
.cli-status .status-error {
  color: #ff0000;
}
.cli-status .icon-terminal,
.cli-status .icon-plus {
  cursor: pointer;
}
